import React from 'react';
import ReactDOM from 'react-dom';
import { globalStyle } from './components';
import { App } from './pages';

ReactDOM.render(
    <React.StrictMode>
        <globalStyle/>
        <App />
    </React.StrictMode>,
    document.getElementById('root')
);
